	public static bool IsLeagueSkinAvailableByLeague(string skinId)
	{
		if (skinId.IsNullOrEmpty())
		{
			Debug.LogErrorFormat("IsLeagueSkinAvailableByLeague: skinId.IsNullOrEmpty()");
			return true;
		}
		if (!leagueSkinsIds.Contains(skinId))
		{
			return true;
		}
		if (sharedController == null)
		{
			Debug.LogErrorFormat("IsLeagueSkinAvailableByLeague: sharedController == null, skinId = {0}", skinId);
			return true;
		}
		if (RatingSystem.instance == null)
		{
			Debug.LogErrorFormat("IsLeagueSkinAvailableByLeague: RatingSystem.instance == null, skinId = {0}", skinId);
			return true;
		}
		if (sharedController.skinItemsDict == null)
		{
			Debug.LogErrorFormat("IsLeagueSkinAvailableByLeague: SkinsController.sharedController.skinItemsDict == null, skinId = {0}", skinId);
			return true;
		}
		SkinItem value;
		if (sharedController.skinItemsDict.TryGetValue(skinId, out value))
		{
			if (value == null)
			{
				Debug.LogErrorFormat("IsLeagueSkinAvailableByLeague: skinItem == null, skinId = {0}", skinId);
				return true;
			}
			return value.currentLeague <= RatingSystem.instance.currentLeague;
		}
		Debug.LogErrorFormat("IsLeagueSkinAvailableByLeague: ! SkinsController.sharedController.skinItemsDict.TryGetValue, skinId = {0}", skinId);
		return true;
	}

