	public static Transform SkinModel(string skinId, int layerForModel, Transform parent, Vector3 offsetSkin, Vector3 scaleSkin)
	{
		Transform transform = null;
		try
		{
			Transform original = Resources.Load<Transform>("Character_model");
			transform = UnityEngine.Object.Instantiate(original);
			transform.GetComponent<CharacterInterface>().SetSimpleCharacter();
			transform.GetComponent<CharacterInterface>().usePetFromStorager = false;
			Player_move_c.SetTextureRecursivelyFrom(transform.gameObject, skinsForPers[skinId], new GameObject[0]);
			Player_move_c.SetLayerRecursively(transform.gameObject, layerForModel);
			transform.parent = parent;
			Renderer[] componentsInChildren = transform.GetComponentsInChildren<Renderer>(true);
			for (int i = 0; i < componentsInChildren.Length; i++)
			{
				componentsInChildren[i].gameObject.layer = parent.gameObject.layer;
			}
			SetTransformParamtersForSkinModel(transform);
			transform.localPosition = offsetSkin;
			transform.localScale = scaleSkin;
			return transform;
		}
		catch (Exception ex)
		{
			Debug.LogError("SkinsController.SkinModel Exception: " + ex);
			return transform;
		}
	}

	public static void SetTransformParamtersForSkinModel(Transform t)
	{
		t.transform.localPosition = new Vector3(1.398438f, 0.2295647f, 0f);
		t.transform.localRotation = Quaternion.Euler(new Vector3(6.837349f, 164.8903f, -1.841095f));
		float num = 30.1665f;
		t.transform.localScale = new Vector3(num, num, num);
	}

	public static string RandomUnboughtSkinId()
	{
		List<string> list = new List<string>();
		foreach (string value in shopKeyFromNameSkin.Values)
		{
			if (value != null && !(value == "super_socialman") && (leagueSkinsIds == null || !leagueSkinsIds.Contains(value)) && IsSkinForMoneySkin(value) && !IsSkinWithStoreKitIdBought(value))
			{
				list.Add(value);
			}
		}
		if (list.Count == 0)
		{
			return string.Empty;
		}
		return list[UnityEngine.Random.Range(0, list.Count)];
	}

	public static List<string> GetSkinsIdList()
	{
		List<string> list = new List<string>();
		foreach (string standardSkinsId in standardSkinsIds)
		{
			if (standardSkinsId != null && !(standardSkinsId == "super_socialman") && (string.IsNullOrEmpty(standardSkinsId) || !IsSkinForMoneySkin(standardSkinsId) || IsSkinWithStoreKitIdBought(standardSkinsId)))
			{
				list.Add(standardSkinsId);
			}
		}
		if (Storager.getInt(Defs.IsFacebookLoginRewardaGained, true) > 0)
		{
			list.Add("super_socialman");
		}
		return list;
	}

