	private void Start()
	{
		for (int i = 0; i < skinItems.Length; i++)
		{
			if (skinItems[i].price > 0)
			{
				shopKeyFromNameSkin.Add(i.ToString(), skinItems[i].name);
				VirtualCurrencyHelper.AddPrice(skinItems[i].name, skinItems[i].price);
			}
			skinsLocalizeKey.Add(skinItems[i].name, skinItems[i].localizeKey);
			standardSkinsIds.Add(skinItems[i].name);
			if (skinItems[i].currentLeague != RatingSystem.RatingLeague.none)
			{
				leagueSkinsIds.Add(skinItems[i].name);
			}
			skinItemsDict.Add(skinItems[i].name, skinItems[i]);
		}
		SetLocalizeForSkins();
		LocalizationStore.AddEventCallAfterLocalize(SetLocalizeForSkins);
	}

	private static void SetLocalizeForSkins()
	{
		if (skinsLocalizeKey.Count == 0)
		{
			return;
		}
		skinsNamesForPers.Clear();
		foreach (KeyValuePair<string, string> item in skinsLocalizeKey)
		{
			if (!skinsNamesForPers.ContainsKey(item.Key))
			{
				skinsNamesForPers.Add(item.Key, LocalizationStore.Get(item.Value));
			}
			else
			{
				skinsNamesForPers[item.Key] = LocalizationStore.Get(item.Value);
			}
		}
	}

	public static Texture2D TextureFromString(string textureString, int w = 64, int h = 32)
	{
		byte[] data = Convert.FromBase64String(textureString);
		Texture2D texture2D = new Texture2D(w, h, TextureFormat.RGBA32, false);
		texture2D.LoadImage(data);
		texture2D.filterMode = FilterMode.Point;
		texture2D.Apply();
		return texture2D;
	}

	public static string StringFromTexture(Texture2D _texture)
	{
		byte[] inArray = _texture.EncodeToPNG();
		return Convert.ToBase64String(inArray);
	}

