			PlayerPrefs.SetInt("firstSkin", nfirstSkin);
		}
		for (int i = 0; i < skinItems.Length; i++)
		{
			string s = ((i != 0) ? skinItems[i].skinStr : randomfirstSkinsForPersInString[nfirstSkin]);
			skinsForPers.Add(skinItems[i].name, TextureFromString(s));
		}
		yield return 0f;
		string _userSkinsForPersInString = PlayerPrefs.GetString("User Skins", string.Empty);
		Dictionary<string, object> userSkinsForPersInStringDictionary2 = null;
		userSkinsForPersInStringDictionary2 = Json.Deserialize(_userSkinsForPersInString) as Dictionary<string, object>;
