		string capeJson = PlayerPrefs.GetString("NewUserCape");
		capeUserTexture = TextureFromString(Tools.DeserializeJson<CapeMemento>(capeJson).Cape, 32);
		capeUserTexture.filterMode = FilterMode.Point;
		capeUserTexture.Apply();
		yield return 0f;
		string _currrentSkinName = PlayerPrefs.GetString("Name Current Skin", "0");
		if (!skinsForPers.ContainsKey(_currrentSkinName))
		{
			int _oldIndex = -1;
			if (int.TryParse(_currrentSkinName, out _oldIndex))
			{
				List<string> _listIds = oldIdsList;
				if (_oldIndex < _listIds.Count)
				{
					_currrentSkinName = _listIds[_oldIndex];
				}
			}
			else
			{
				_currrentSkinName = "0";
			}
