	public static void SetCurrentSkin(string name)
	{
		if (Defs.IsDeveloperBuild)
		{
			Debug.LogFormat("SetCurrentSkin({0})", name);
		}
		if (string.IsNullOrEmpty(name))
		{
			name = "0";
		}
		string arg = currentSkinNameForPers ?? string.Empty;
		if (!skinsForPers.TryGetValue(name, out currentSkinForPers))
		{
			return;
		}
		currentSkinNameForPers = name;
		if (currentSkinForPers.width != 64 || currentSkinForPers.height != 32)
		{
			currentSkinForPers = skinsForPers["0"];
			currentSkinNameForPers = "0";
		}
		else
		{
			Color[] pixels = currentSkinForPers.GetPixels();
			for (int i = 0; i < pixels.Length; i++)
			{
				pixels[i].a = 1f;
			}
			currentSkinForPers.SetPixels(pixels);
		}
		PlayerPrefs.SetString("Name Current Skin", name);
		Action<string, string> equippedSkin = SkinsController.EquippedSkin;
		if (equippedSkin != null)
		{
			equippedSkin(currentSkinNameForPers, arg);
		}
	}

	public static string AddUserSkin(string _nameUserSkin, Texture2D _texture, string nameSkinOld = null)
	{
		long num;
		if (nameSkinOld == null)
		{
			num = DateTime.UtcNow.Ticks;
			foreach (KeyValuePair<string, Texture2D> skinsForPer in skinsForPers)
			{
				long result;
				if (long.TryParse(skinsForPer.Key, out result) && result > num)
				{
					num = result;
				}
			}
			num++;
		}
		else
		{
			num = long.Parse(nameSkinOld);
			skinsForPers.Remove(nameSkinOld);
			customSkinIds.Remove(nameSkinOld);
			skinsNamesForPers.Remove(nameSkinOld);
		}
		string text = num.ToString(CultureInfo.InvariantCulture);
		skinsForPers.Add(text, _texture);
		customSkinIds.Add(text);
		skinsNamesForPers.Add(text, _nameUserSkin);
		string @string = PlayerPrefs.GetString("User Skins", string.Empty);
		Dictionary<string, object> dictionary = Json.Deserialize(@string) as Dictionary<string, object>;
		if (dictionary == null)
		{
			Debug.Log("(userSkinsForPersInStringDictionary==null)");
			dictionary = new Dictionary<string, object>();
		}
		dictionary[text] = StringFromTexture(_texture);
		PlayerPrefs.SetString("User Skins", Json.Serialize(dictionary));
		string string2 = PlayerPrefs.GetString("User Name Skins", string.Empty);
		Dictionary<string, object> dictionary2 = null;
		dictionary2 = Json.Deserialize(string2) as Dictionary<string, object>;
		if (dictionary2 == null)
		{
			Debug.Log("userNameSkinsForPersInStringDictionary==null");
			dictionary2 = new Dictionary<string, object>();
		}
		dictionary2[text] = _nameUserSkin;
		PlayerPrefs.SetString("User Name Skins", Json.Serialize(dictionary2));
		if (BuildSettings.BuildTargetPlatform == RuntimePlatform.IPhonePlayer)
		{
			SkinsSynchronizer.Instance.Sync();
		}
		else
		{
			SkinsSynchronizer.Instance.Push();
		}
		return text;
	}

	public static void DeleteUserSkin(string _name)
	{
		skinsForPers.Remove(_name);
		customSkinIds.Remove(_name);
		skinsNamesForPers.Remove(_name);
		if (_name.Equals(currentSkinNameForPers))
		{
			SetCurrentSkin("0");
		}
		string @string = PlayerPrefs.GetString("DeletedSkins", string.Empty);
		List<object> list = Json.Deserialize(@string) as List<object>;
		List<string> list2 = ((list == null) ? new List<string>() : list.OfType<string>().Distinct().ToList());
		string string2 = PlayerPrefs.GetString("User Skins", string.Empty);
		Dictionary<string, object> dictionary = Json.Deserialize(string2) as Dictionary<string, object>;
		if (dictionary != null)
		{
			if (dictionary.ContainsKey(_name))
			{
				dictionary.Remove(_name);
				PlayerPrefs.SetString("User Skins", Json.Serialize(dictionary));
				list2.Add(_name);
			}
			else
			{
				Debug.LogError("SkinsController error: name user skin not found!");
			}
		}
		else
		{
			Debug.LogError("SkinsController error: not parse userSkinsForPersInStringDictionary!");
		}
		@string = Json.Serialize(list2);
		PlayerPrefs.SetString("DeletedSkins", @string);
		string string3 = PlayerPrefs.GetString("User Name Skins", string.Empty);
		Dictionary<string, object> dictionary2 = Json.Deserialize(string3) as Dictionary<string, object>;
		if (dictionary2 != null)
		{
			if (dictionary2.ContainsKey(_name))
			{
				dictionary2.Remove(_name);
				PlayerPrefs.SetString("User Name Skins", Json.Serialize(dictionary2));
			}
			else
			{
				Debug.LogError("SkinsController error: name user skin not found!");
			}
		}
		else
		{
			Debug.LogError("SkinsController error: not parse userSkinsForPersInStringDictionary!");
		}
		if (BuildSettings.BuildTargetPlatform == RuntimePlatform.IPhonePlayer)
		{
			SkinsSynchronizer.Instance.Sync();
		}
		else
		{
			SkinsSynchronizer.Instance.Push();
		}
	}

