	public static byte[] ReadAllBytes(string path)
	{
		using (FileStream fileStream = new FileStream(path, FileMode.Open, FileAccess.Read))
		{
			int num = 0;
			long length = fileStream.Length;
			if (length > int.MaxValue)
			{
				throw new IOException("File is too long.");
			}
			int num2 = (int)length;
			byte[] array = new byte[num2];
			while (num2 > 0)
			{
				int num3 = fileStream.Read(array, num, num2);
				if (num3 == 0)
				{
					throw new EndOfStreamException("Read beyond end of file.");
				}
				num += num3;
				num2 -= num3;
			}
			return array;
		}
	}

	public static void SetTextureRecursivelyFrom(GameObject obj, Texture txt, GameObject[] stopObjs = null)
	{
		foreach (Transform item in obj.transform)
		{
			bool flag = false;
			if (stopObjs != null)
			{
				foreach (GameObject o in stopObjs)
				{
					if (item.gameObject.Equals(o))
					{
						flag = true;
						break;
					}
				}
				if (flag)
				{
					continue;
				}
			}
			if ((bool)item.gameObject.GetComponent<Renderer>() && (bool)item.gameObject.GetComponent<Renderer>().material)
			{
				item.gameObject.GetComponent<Renderer>().material.mainTexture = txt;
			}
			flag = false;
			if (stopObjs != null)
			{
				foreach (GameObject o2 in stopObjs)
				{
					if (item.gameObject.Equals(o2))
					{
						flag = true;
						break;
					}
				}
			}
			if (!flag)
			{
				SetTextureRecursivelyFrom(item.gameObject, txt, stopObjs);
			}
		}
	}

	private static string GetSkinNameForObj(string objName)
	{
		if (Defs.IsSurvival)
		{
			return objName;
		}
		if (!TrainingController.TrainingCompleted)
		{
			return string.Format("{0}_Level3", objName);
		}
		return string.Format("{0}_Level{1}", objName, CurrentCampaignGame.currentLevel);
	}

	public static Texture GetSkinForObj(GameObject targetObj)
	{
		SkinsManagerPixlGun component = GameObject.FindGameObjectWithTag("SkinsManager").GetComponent<SkinsManagerPixlGun>();
		if (component == null)
		{
			return null;
		}
		Texture texture = null;
		string skinNameForObj = GetSkinNameForObj(targetObj.name);
		if (component.skins.Contains(skinNameForObj))
		{
			texture = component.skins[skinNameForObj] as Texture;
		}
		else
		{
			Debug.Log("No skin: " + skinNameForObj);
		}
		SetTextureRecursivelyFromObj(targetObj, texture);
		return texture;
	}

	public static void SetTextureRecursivelyFromObj(GameObject obj, Texture texture)
	{
		foreach (Transform item in obj.transform)
		{
			Renderer component = item.gameObject.GetComponent<Renderer>();
			if (!(component == null) && !(component.material == null))
			{
				component.material.mainTexture = texture;
				SetTextureRecursivelyFromObj(item.gameObject, texture);
			}
		}
	}

	private void MigrateToGloballyUniqueIds()
	{
		MigrateSkinsToGloballyUniqueIds();
		MigrateCapesToGloballyUniqueIds();
	}

	private void MigrateCapesToGloballyUniqueIds()
	{
		string callee = string.Format(CultureInfo.InvariantCulture, "{0}.MigrateCapesToGloballyUniqueIds()", GetType().Name);
		ScopeLogger scopeLogger = new ScopeLogger(callee, false);
		try
		{
			string @string = PlayerPrefs.GetString("NewUserCape", string.Empty);
			if (!string.IsNullOrEmpty(@string))
			{
				if (Defs.IsDeveloperBuild)
				{
					Debug.Log("Cape is up to date.");
				}
			}
			else
			{
				long ticks = DateTime.UtcNow.Ticks;
				string string2 = PlayerPrefs.GetString("User Cape Skin", string.Empty);
				CapeMemento capeMemento = new CapeMemento(ticks, string2);
				@string = JsonUtility.ToJson(capeMemento);
				PlayerPrefs.SetString("NewUserCape", @string);
			}
		}
		finally
		{
			scopeLogger.Dispose();
		}
	}

	private void MigrateSkinsToGloballyUniqueIds()
	{
		string callee = string.Format(CultureInfo.InvariantCulture, "{0}.MigrateSkinsToGloballyUniqueIds()", GetType().Name);
		ScopeLogger scopeLogger = new ScopeLogger(callee, false);
		try
		{
			long ticks = DateTime.UtcNow.Ticks;
			string @string = PlayerPrefs.GetString("User Name Skins", string.Empty);
			Dictionary<string, object> dictionary = (Json.Deserialize(@string) as Dictionary<string, object>) ?? new Dictionary<string, object>();
			Dictionary<string, object> dictionary2 = new Dictionary<string, object>();
			bool flag = false;
			foreach (KeyValuePair<string, object> item in dictionary)
			{
				try
				{
					long num = Convert.ToInt64(item.Key);
					if (num < 10000)
					{
						flag = true;
					}
					dictionary2[((num >= 10000) ? num : (ticks - num)).ToString(CultureInfo.InvariantCulture)] = item.Value;
				}
				catch (Exception exception)
				{
					Debug.LogException(exception);
				}
			}
			if (!flag)
			{
				if (Defs.IsDeveloperBuild)
				{
					Debug.LogFormat("Skins are up to date: {0}", @string);
				}
				return;
			}
			string value = Json.Serialize(dictionary2);
			PlayerPrefs.SetString("User Name Skins", value);
			string string2 = PlayerPrefs.GetString("User Skins", string.Empty);
			Dictionary<string, object> dictionary3 = (Json.Deserialize(string2) as Dictionary<string, object>) ?? new Dictionary<string, object>();
			Dictionary<string, object> dictionary4 = new Dictionary<string, object>();
			foreach (KeyValuePair<string, object> item2 in dictionary3)
			{
				try
				{
					long num2 = Convert.ToInt64(item2.Key);
					dictionary4[((num2 >= 10000) ? num2 : (ticks - num2)).ToString(CultureInfo.InvariantCulture)] = item2.Value;
				}
				catch (Exception exception2)
				{
					Debug.LogException(exception2);
				}
			}
			string value2 = Json.Serialize(dictionary4);
			PlayerPrefs.SetString("User Skins", value2);
			if (BuildSettings.BuildTargetPlatform == RuntimePlatform.IPhonePlayer)
			{
				SkinsSynchronizer.Instance.Sync();
			}
			else
			{
				SkinsSynchronizer.Instance.Push();
			}
			string string3 = PlayerPrefs.GetString("Name Current Skin", "-1");
			long result;
			if (!long.TryParse(string3, out result))
			{
				result = -2147483648L;
			}
			if (result < 10000)
			{
				PlayerPrefs.SetString("Name Current Skin", (ticks - result).ToString(CultureInfo.InvariantCulture));
			}
		}
		catch (Exception exception3)
		{
			Debug.LogException(exception3);
		}
		finally
		{
			scopeLogger.Dispose();
		}
	}
